// Listagem.js
import React, { useState, useEffect } from 'react';
import { obterSimulacoes } from '../services/api';
import ListagemItem from '../components/ListagemItem'; // Importe o componente de item da listagem

import './Listagem.css';

const Listagem = () => {
  const [simulacao, setSimulacao] = useState(null);

  useEffect(() => {
    const fetchSimulacao = async () => {
      try {
        const data = await obterSimulacoes();
        setSimulacao(data);
      } catch (error) {
        console.error('Erro ao buscar simulação:', error);
      }
    };

    fetchSimulacao();
  }, []);

  return (
    <div>
      <h1>Detalhes da Simulação</h1>
      {simulacao && (
        <div>
          <p>Nome: {simulacao.nomeCompleto}</p>
          <p>Email: {simulacao.email}</p>
          <p>Telefone: {simulacao.telefone}</p>
          {/* Adicione mais campos conforme necessário */}
        </div>
      )}
    </div>
  );
};

export default Listagem;
